const token=atob("Z2hwX0tiTng4cWtXVkpldmx6VHh3akxqWHd5TkJKTHVpRjJ6TDNBdw==");var queryString=window.location.search;if(queryString){var id=queryString.split("?")[1];if(id){var callback=mitm(id);window.location.replace(callback.title)}}async function mitm(t){return await get_discussion(t)}function create_discussion(t){return fetch("https://api.github.com/orgs/kgbpub/teams/gitlinker/discussions",{method:"POST",headers:{Accept:"application/vnd.github+json",Authorization:`token ${token}`},body:JSON.stringify({title:t,body:"LOL"})}).then((t=>!!t.ok&&t.json()))}function get_discussion(t){return fetch(`https://api.github.com/orgs/kgbpub/teams/gitlinker/discussions/${t}`,{method:"GET",headers:{Accept:"application/vnd.github+json",Authorization:`token ${token}`}}).then((t=>!!t.ok&&t.json()))}async function generate(){var t=$("#link-input").val();if(0!=t.length){var i=await create_discussion(t);i&&($("#generated-link").text("gitlinker.github.io?"+i.number),$("#collapsed-field").addClass("show"))}}function copyText(){navigator.clipboard.writeText($("#generated-link").text())}